Step-by-step reasoning:
1. Key psychological mechanism: In the ultimatum game, responders evaluate offers not only based on their monetary gain but also on fairness perceptions. Even if accepting an offer yields money, responders may reject offers if the inequality (the difference between their share and the proposer's share) is too large.
2. Interaction of mechanisms: The model adjusts the monetary value of the offer (split_self) by subtracting a disutility for advantageous inequality (the difference between split_self and split_opp) scaled by an inequality aversion parameter.
3. Mathematical form: Given that in this dataset split_self is always greater than split_opp, we only need to capture the disutility from receiving more than the opponent (i.e. guilt aversion or aversion to advantageous inequality). The utility can thus be expressed as the offered amount minus a penalty term proportional to the difference between split_self and split_opp.
4. Needed parameter: A single learnable parameter, beta, captures the sensitivity to advantageous inequality. Lower offers with a large difference will yield lower utility, potentially becoming negative and leading to a rejection.
5. Observable mapping: split_self and split_opp are observed in the dataset. The utility computed by the model (U_accept) determines the likelihood of accepting the offer (with more negative values representing unappealing offers).

Below is the formal model specification and variable description.

<MODEL>
U_accept = split_self - beta*(split_self - split_opp)
</MODEL>

